Bio: I am a very pleasant girl. I love to dance in the club and I love when people watch me. I love a beach rest: to sunbathe in beams of the morning sun and to bathe in the warm sea, on empty wild beaches. I like to look in a mirror at myself during trips, especially my hair with an open window. I love the exotic countries which is the reason I choose for myself this profession. I love an active lifestyle. In the future I plan to open my small travel business.
